script: |
  super -f text -I q11069.spq | sort > q11069.out

inputs:
  - name: q11069.spq
    data: |
      SELECT + 68 AS col1, col1 AS col0 FROM tab1 (FORMAT parquet) WHERE col2 + col1 * + + col1 * col1 * 89 IS NOT NULL;
  - name: tab1

outputs:
  - name: q11069.out
    data: |
      68	14
      68	47
      68	5
